window.bookSummaryJSON = "<p>Betrayal. Vengeance. Loyalty. Dark forces are at work in the epic conclusion of the <i>USA Today</i> bestselling Crossbreed series.</p> <p>Raven has come a long way since joining Keystone. She embraced her Vampire side, learned to work with others, and even fell in love. But how far is she willing to go for the greater good?</p> <p>When Viktor receives an anonymous tip regarding the whereabouts of the most notorious oligarchs in the Breed world, Keystone's courage is put to the test. The stakes are high—one wrong move could have catastrophic consequences. In a shocking turn of events, Christian's recent disappearance reveals secrets that could ruin him. The past is finally catching up, and Raven is faced with her greatest decision yet—one that could seal her fate forever.</p> <p>Will Keystone deliver the justice these men deserve, or will the cost be greater than the reward? Find out in this powerful conclusion to the Crossbreed series.</p> <p>The hardest demons to conquer are often our own.</p>"; 
